import './App.css';
import React from 'react';
import { Routes, Route} from 'react-router-dom';
import IniciarApp from './componentes/IniciarApp';
import 'bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';



function App() {
  return (
    <div className="App">

    <Routes>
      <Route path="/" element={<IniciarApp/>}></Route>
    </Routes>
    </div>
  );
}

export default App;
